import React, { Component } from 'react';
import { Nav } from 'reactstrap';
import styles from './Header.module.scss';

export default class Header extends Component {
    constructor(props){
        super(props);
    }


    render() {

        return (
            <nav className={styles.block}></nav>
        );
    }
}
